import React, { Fragment } from 'react';

const AppMap = (props) => {
    const {title, desc, id} = props.todoapp;
    // const  { id } = props;
    return (
        <Fragment>
                 <article>
                    <div>
                    <h2>{title}</h2>
                     <p>{desc}</p>
                    </div>
                 </article>
             </Fragment>
    );
};
export default AppMap;
